import React from 'react';
import './FotTwo.css';

export default class FotTwo extends React.Component {
  render() {
    return (
      <div className='fottwo'>
        <div className='fot3'>
          <div className='foticon'>
            <p>
              <i class='fab fa-twitter'></i>
            </p>
            <p></p>
            <p></p>
          </div>
        </div>
      </div>
    );
  }
}
